import Home from './pages/Home';
import Gallery from './pages/Gallery';

function App() {
  return (
    <div className="App">
      <Home path= '/' exact component= {Home} />
      <Gallery path= 'gallery' exact component= {Gallery} />
      <Gallery path= 'about' exact component= {Gallery} />
    </div>
  );
}

export default App;
